import React from 'react'
import Layout from '../layout/layout'


export default function services() {
  return (
    <Layout>
    <div >
    <div >
      {languages.map((language) => {
        return <div>
        <div className="row">
          <div className="col-sm-2">
        <div className="card">
        <div className="card-header">{language.id}</div>
        <div className="card-body">{language.quote}</div>
        <div className="card-footer">{language.author}</div>
        </div>
        </div>
        </div>
        
        </div>;


      })}
    </div>    </div>
    </Layout>
  )
}
